import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";
  
export default function Products({ match }) {
  return (
    <>
    <h3>ID: {match.params.slug}</h3>
    </>
  );
}
